BEGIN;
CREATE TABLE IF NOT EXISTS Addresses (
	ID	int NOT NULL AUTO_INCREMENT,
	Location varchar(255) NOT NULL,
	StreetAddress varchar(255),
	Coordinates	varchar(255),
	MapLink	varchar(255),
	Directions	varchar(255),
	NearestBins varchar(255),
	PRIMARY KEY(ID)
);
CREATE TABLE IF NOT EXISTS "charges" (
	"ID"	integer NOT NULL,
	"stay_ID"	,
	"currency"	,
	"basic_rental_charge"	,
	"admin_charge"	,
	"discounts"	,
	"total_rental_charge"	,
	"security_charge"	,
	"security_charge_method"	,
	"bank_transfer"	,
	"credit_card"	,
	"total_platform_charge"	,
	"platform_fee"	,
	"extra_nights"	,
	"manual_charges"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "emails" (
	"ID"	integer NOT NULL,
	"stay_ID"	,
	"four_weeks"	,
	"security_deposit_request"	,
	"joining_instructions"	,
	"airport_transfers"	,
	"management"	,
	"guest_registration_form"	,
	"pay_owner"	,
	"final_days_reminder"	,
	"return_security_deposit"	,
	"goodbye"	,
	"balance_payment"	,
	"guest_registration_form_to_owner"	,
	"pause_emails"	,
	"check_in_information"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "extras" (
	"ID"	integer NOT NULL,
	"stay_ID"	,
	"airport_transfers"	,
	"airport_transfer_inbound_only"	,
	"airport_transfer_outbound_only"	,
	"welcome_pack"	,
	"welcome_pack_modifications"	,
	"cot"	,
	"high_chair"	,
	"mid_stay_clean"	,
	"late_checkout"	,
	"other"	,
	"child_seats"	,
	"extra_nights"	,
	"excess_baggage"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "flights" (
	"ID"	integer NOT NULL,
	"stay_ID"	,
	"inbound_number"	,
	"inbound_time"	,
	"is_Faro_landing"	,
	"outbound_number"	,
	"outbound_time"	,
	"is_Faro_take_off"	,
	"arrival_details"	,
	"departure_details"	,
	"self_check_in"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "forms" (
	"ID"	integer NOT NULL,
	"stay_ID"	,
	"security_deposit"	,
	"guest_registration"	,
	"balance_payment"	,
	"owner_booking"	,
	"four_weeks"	,
	"guest_registration_done"	,
	"PIMS_uin"	,
	"PIMS_oid"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "guests" (
	"ID"	integer NOT NULL,
	"first_name"	,
	"last_name"	,
	"email"	,
	"phone"	,
	"nationality"	,
	"id_card_number"	,
	"nif_number"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS Managers (
	ID	integer NOT NULL AUTO_INCREMENT,
	Company varchar(255) NOT NULL,
	CompanyPhone varchar(255),
	CompanyEmail varchar(255),
	HeadManager varchar(255),
	HeadManagerPhone varchar(255),
	HeadManagerEmail varchar(255),
	MaintenanceManager varchar(255),
	MaintenanceManagerPhone varchar(255),
	MaintenanceManagerEmail varchar(255),
	LiaisonManager varchar(255),
	LiaisonManagerPhone varchar(255),
	LiaisonManagerEmail varchar(255),
	CleaningManager varchar(255),
	CleaningManagerPhone varchar(255),
	CleaningManagerEmail varchar(255),
	PRIMARY KEY(ID)
);
CREATE TABLE IF NOT EXISTS Owners (
	ID	integer NOT NULL AUTO_INCREMENT,
	LastName VARCHAR(255) NOT NULL,
	FirstName VARCHAR(255) NOT NULL,
	Email varchar(255) ,
	Phone varchar(255),
	NifNumber varchar(255),
	DefaultClean boolean,
	DefaultMeetGreet boolean,
	TakesEuros boolean,
	TakesPounds boolean,
	WantsAccounting boolean,
	InvoiceAllCleans boolean,
	InvoiceAllRentals boolean,
	PaidRegularly boolean,
	PRIMARY KEY(ID)
);
CREATE TABLE IF NOT EXISTS Prices (
	ID	integer NOT NULL,
	Name varchar(255) NOT NULL,
	January float	,
	February float	,
	March float	,
	April float	,
	May float	,
	June float	,
	July float	,
	August float	,
	September float	,
	October float	,
	November float	,
	December float	,
	Festive float	,
	PRIMARY KEY(ID)
);
CREATE TABLE IF NOT EXISTS Properties (
	ID	integer NOT NULL AUTO_INCREMENT,
	Name	varchar(255) NOT NULL,
	ShortName varchar(255),
	AlNumber varchar(255),
	BookingComName	varchar(255),
	AirbnbName	varchar(255),
	WeClean boolean,
	WeBook	boolean,
	Bedrooms int,
	Bathrooms int,
	SquareMetres int,
	MinimumStay	boolean,
	IsListed boolean,
	IsSeaView	boolean,
	IsUpperFloor boolean,
	IsBeachfront boolean,
	StandardCleaningFee	float,
	WeRegisterGuests boolean,
	OwnerRegistersGuests boolean,
	OwnerBookingForms boolean,
	OwnerID	int,
	ManagerID int,
	AddressID int,
	PriceTierID	int,
	PRIMARY KEY(ID),
	FOREIGN KEY(OwnerID) REFERENCES Owners(ID),
    FOREIGN KEY(ManagerID) REFERENCES Managers(ID),
	FOREIGN KEY(AddressID) REFERENCES Addresses(ID),
    FOREIGN KEY(PriceTierID) REFERENCES Prices(ID)
);
CREATE TABLE IF NOT EXISTS "stays" (
	"ID"	integer NOT NULL,
	"PIMS_ID"	,
	"property_ID"	,
	"guest_ID"	,
	"owner_booking"	,
	"arrival_date"	,
	"departure_date"	,
	"arrival_time"	,
	"departure_time"	,
	"adults"	,
	"children"	,
	"babies"	,
	"owner_clean"	,
	"owner_meet_greet"	,
	"enquiry_date"	,
	"enquiry_source"	,
	"enquiry_status"	,
	"database_origin"	,
	"last_updated"	,
	"platform_ID"	,
	"manual_dates"	,
	"manual_guests"	,
	PRIMARY KEY("ID")
);
CREATE TABLE IF NOT EXISTS "updates" (
	"ID"	integer NOT NULL,
	"PIMS_ID"	,
	"stay_ID"	,
	"date"	,
	"new_booking"	,
	"cancelled_booking"	,
	"updated_booking"	,
	"added_extra"	,
	"cancelled_extra"	,
	"updated_extra"	,
	"sent"	,
	"update_transfers"	,
	PRIMARY KEY("ID")
);
COMMIT;
